import React from "react";

import "./../App.css";

function Header() {
  return (
    <>
      <img
        src="https://wallpaperaccess.com/full/124631.jpg"
        alt="Star_Wars_Header_Image"
        height="100%"
        width="100%"
      />
      <h1>Welcome to the Star Wars information corner!</h1>
      <h3>Click on a button to learn more about Star Wars.</h3>
      <br />
      <br />
    </>
  );
}

export default Header;
